First EP from Polish Hardcore Band 72 DESPERATE REBELS

72DR plays something between old hardcore and evil metal. The band started in 1999 and ceased to exist shortly after, leaving only handful of rehearsal recordings behind. Brought back to life in February 2013 in original line-up, 72DR recorded their debut EP entitled &quot;Ostrowskie&quot; during autumn days of the same year. It will be released as a CD soon.

